import React from 'react'

 function About() {
  return (
    <div className='about'>
    <h1>AboutUS</h1>
    <p>
    In our "About" section, we are dedicated to providing you with the knowledge and tools to become proficient in HTML tags and JavaScript. 
    Our tutorials cover ES5 and ES6, and you'll have access to plenty of exercises to help you sharpen your skills. 
    You'll also get a chance to explore React.js and learn about both class and functional components, as well as play some fun React.js games.
    In addition to all of that, we also delve into more advanced topics such as asynchronous programming and APIs. Whether you're a beginner 
    or an experienced developer, we have something for everyone here at our About section. 
    </p>

    </div>
  )
}




export default  About;
